import styled from 'styled-components';

const Register = () => {

    const handleSubmit = (e) => {
        e.preventDefault();
        console.log('submit');
    }

    return (
        <FormContainer>
            <form onSubmit={(e)=handleSubmit(e)}></form>
        </FormContainer>
    );
}

const FormContainer = styled.div``;

export default Register;
